INSERT INTO `user` VALUES (15, 'mirtjernej@gmail.com', 'sha256:1000:mMYTUojWw6YzTP+4QNc47hpfs/4+TF/e:KKG69T5HEVUmr8YBcF2MKjS/hgQwVJ3d', '0db12a7d965f0275b1c02ae448d57c13', '2014-01-04 14:08:55', '2014-02-09 17:04:43', 1, 1, 'Jernej', 'Mirt', NULL, NULL, NULL, 1, 5, 'bla bla bla', NULL);
INSERT INTO `user` VALUES (16, 'jur2402@gmail.com', 'sha256:1000:rtvUedxpbLDqegpi9Ho2xE7qhWal3N1Q:xszXzKgRDjUJd3JEyCV1PcUZE7PN59gY', 'd3ac916a4019547865050bba59e5321e', '2014-01-05 07:33:38', '2014-02-09 17:53:21', 1, 1, 'Jure', 'Ravlič', 'Pot na Fužine 23', '13889314795468.jpg', NULL, 1, 5, 'I work as a freelancer. I build and design small to large websites. In my spare time I work on a startup project CoFinder in an awesome team.\r\n\r\nI''ve been interested in computers from the very young age. I developed my design skills trough drawing and lettering and as popularity of internet grew, I applied them to the web. I struggled with my first websites, but once i got a hang of it, I never looked back.  I work with a mindset of solving business problems and making appealing products as I go along.\r\n\r\nWhen not working or learning, I occasionally go to Lindy hop or 6-count swing parties at Caffee Union and SEM. I also like to play basketball or go sport climbing.', NULL);
