INSERT INTO `user` VALUES (18, 'jure.ravlic@gmail.com', 'sha256:1000:zV0rEV33DtmvQe9JgvpWcGuO2rN5MrXx:jGy7SIy23daivIcbbik3z1bz+wZjZE9A', '550a96efb4dfe8807a14e1719b6673a6', '2014-01-27 09:10:00', '0000-00-00 00:00:00', 0, 0, 'Jure', 'Ravlič', 'Pot na Fužine 23', '13908336987395.png', NULL, 1, 5, 'Dokazano je, da razumljiva vsebina, med pregledovanjem oblikovne rešitve določene strani, neželeno preusmeri pozornost bralca. Ker ima Lorem Ipsum relativno enakomerno razporeditev znakov uspešno nadomesti začasna vsebinsko pomenska besedila. Veliko namizno založniških programov in spletnih urejevalnikov uporablja Lorem Ipsum kot privzeti slepi tekst. Zato spletno iskanje s ključnimi besedami "lorem ipsum" vrne številne zadetke še nedokončanih spletnih mest. Tekom let so namreč nastale številne različice tega slepega teksta, bodisi nenačrtovano ali namenoma, z različnimi šaljivimi in drugimi vložki.', NULL);
